import React, { Component } from "react";
import { Grid, Image, Container } from "semantic-ui-react";
const facebook = "https://react.semantic-ui.com/images/wireframe/image.png";
import "../../grid.min.css";

class Footer extends Component {
  render() {
    return (
      <Container
        style={{
          marginLeft: "auto",
          marginRight: "auto",
          width: "1040px",
          height: "384px",
          background: "gray",
        }}>
        <div class="ui grid ">
          <div class="row" style={{ columnGap: "60px", alignItems: "left" }}>
            <div class="four wide column">
              <Container style={{ textAlign: "left" }}>
                <p>Let's staty connected!</p>
                <p>
                  Enter your email to receive the latest news and opportunities
                  from the TEDxUW Community.
                </p>
              </Container>
            </div>
            <div class="two wide column">Contact</div>
            <div class="one wide column">test</div>
          </div>
        </div>
      </Container>
    );
  }
}

export default Footer;
